import { createSlice } from "@reduxjs/toolkit";
import FeedbackModel from '../model/FeedbackModel';

const FeedbackSlice = createSlice({
    name:'feedback',

    initialState: {

        feedbackState: new FeedbackModel(),
    },

    reducers: {
        getFeedBackById: (state, action) => {
            console.log("FeedbackSlice reducers getFeeBackById");
            state.feedbackState = action.payload;
        },
        getAllFeed: (state, action) => {
            console.log('NgoSlice reducers getAllNgo');
            state.ngoList = action.payload;
        }
    }
}

);

export const {getFeedBackById} = FeedbackSlice.actions;
export default FeedbackSlice.reducer;
